function MovieList() {
    let movie = {
        title:'Spiderman : Far From Home'
    }

    return(
        <div className="movie-list">
            <MovieItem />
            <MovieItem />
            <MovieItem />
            <MovieItem />
            <MovieItem />
            <MovieItem />
            <MovieItem />
            <MovieItem />
            <MovieItem />
            <MovieItem />
        </div>
    )
}

export default MovieList;
